import React from 'react'
import {makeStyles} from '@material-ui/core/styles'
import 'font-awesome/css/font-awesome.min.css';
import './Icons.css'

const useStyles = makeStyles((theme) => ({
    logosContainer:{
        color: 'darkgrey', 
        display: 'flex', 
        justifyContent: 'space-around', 
        widht: '100%',
        [theme.breakpoints.down('xs')]:{
            marginTop: '10%',
            justifyContent: 'space-evenly',
            fontSize: '1.1rem',
            textAlign: 'center'
          },
        [theme.breakpoints.up('sm')]:{
            marginTop: '10%',
            justifyContent: 'space-evenly',
            fontSize: '3rem',
            textAlign: 'center'
          },
        [theme.breakpoints.up('lg')]:{
        marginTop: '2%'
        }
    },
    divLogo:{
        display: 'flex', 
        flexDirection: 'column'
    }, 
    balance:{
        marginLeft: '-4%'
    },
    extra:{
        [theme.breakpoints.up('md')]:{
            display: 'flex'
          }       
    },
    icons:{
        [theme.breakpoints.up('md')]:{
            color: 'hotpink'
          }       
    }
}))

export default function Icons(){
    const classes = useStyles()

    return(
        <div className = {classes.extra}>
            <div className = {classes.logosContainer}>
                <div className = {classes.divLogo}>
                    <i  className="fab fa-html5"></i>HTML5
                </div>
                <div className = {classes.divLogo}>
                    <i style = {{fontSize: '2rem', textAlign: 'center'}} className="fab fa-css3-alt"></i>CSS3
                </div>
                <div className = {classes.divLogo}>
                    <i style = {{fontSize: '2rem', textAlign: 'center'}} className="fab fa-js-square"></i>JS
                </div>
            </div>
            <div className = {classes.logosContainer}>
                <div className = {classes.divLogo}>
                    <i style = {{fontSize: '2rem', textAlign: 'center'}} className="fab fa-react"></i>React
                </div>
                <div className = {classes.divLogo}>
                    <i style = {{fontSize: '2rem', textAlign: 'center'}} className="fab fa-node"></i>Node
                </div>
                <div className = {classes.divLogo}>
                    <i style = {{fontSize: '2rem', textAlign: 'center'}} className="fab fa-git-square"></i>Git
                </div>
            </div>
        </div>
    )
}
